import React from 'react';
import './Msg.css';
import { TweenMax } from 'gsap';

// Return Msg Compoent view
export default function ReturnMsg() {

 React.useEffect(() => {

  TweenMax.from('.wrp-msg-register', 1.2, { delay: 1, opacity: 0, y: 20, ease: Linear.easeOut })

 })

 return (
  <div className='wrp-msg-register'>Enregistre avec success</div>
 )
};
